import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'semantic-ui-css/semantic.min.css'
import { Grid, Dimmer, Loader, Modal, Button, List, Icon, Segment, Container} from 'semantic-ui-react'
import ReadWalletFile from './utils/ReadWalletFile';
import Arweave from 'arweave/web';
import ReadReceipt from './utils/ReadReceipt';
import CryptoJS from "crypto-js"
import jwkToPem from 'jwk-to-pem'

const arweave = Arweave.init({
    host: 'arweave.net',// Hostname or IP address for an Arweave node
    port: 443,           // Port, defaults to 1984
    protocol: 'https',  // Network protocol http or https, defaults to http
    timeout: 20000,     // Network request timeouts in milliseconds
    logging: false,     // Enable network request logging
})

const getReceiptsTxList = async(arAddress) => {
  try{
    const query = {
      op: 'and',
      expr1: {
          op: 'equals',
          expr1: 'from',
          expr2: arAddress
      },
      expr2: {
          op: 'equals',
          expr1: 'App-Name',
          expr2: 'receipts-archiver'
      }     
    }
    const result = await arweave.arql(query);
    return result
  }catch(err){
    console.log(err)
    return []
  }  
}


class App extends React.Component{
  state = {
    loading:false,
    walletLoad:false,
    userAddress:'',
    walletFile:'',
    arBalance:'',
    fee:'',
    transaction:'',
    txView:'',
    rctDataView:'',
    openModalView:false
  }

  isFileReceipt = (file) => {
    return file && file['type'].split('/')[0] === 'application';
}

  WalletUpload = async(e) => {
    try{    
      this.setState({loading:true})
      const rawWallet = await ReadWalletFile(e.target.files[0])
      const walletFile = JSON.parse(rawWallet)
      const userAddress = await arweave.wallets.jwkToAddress(walletFile)
      const winstonBalance =  await arweave.wallets.getBalance(userAddress)
      const arBalance = await arweave.ar.winstonToAr(winstonBalance)
      const listTxImg = await getReceiptsTxList(userAddress)
      this.setState({walletLoad:true, walletFile, userAddress, arBalance, loading:false, listTxImg})
    }catch(err){
      this.setState({loading:false})
      alert('Error Loading Wallet')
    }
  }

  loadReceipt = async(e) => {
    try{
      this.setState({loading:true})
      const rctData = await ReadReceipt(e.target.files[0])
      if(rctData){
        const pvKey = await jwkToPem(this.state.walletFile,{private:true})
        const rctEncrypted = await CryptoJS.AES.encrypt(rctData, pvKey)
        const ImgEcryptedString = await rctEncrypted.toString()
        const data = ImgEcryptedString   
        let transaction = await arweave.createTransaction({
            data
        }, this.state.walletFile);
        transaction.addTag('App-Name', 'receipts-archiver');
        const fee = await arweave.ar.winstonToAr(transaction.reward)
        this.setState({fee, transaction, rctData, openModalTx:true, loading:false })   


      }else{
        this.setState({loading:false})
        alert('Sorry, currently Pdf Only')
      }
    }catch(err){
      console.log(err)
      this.setState({loading:false})
      alert('Error Loading Pdf')
    }
}

close = () => {
  if(this.state.loading){
    return 
  }else{
    this.setState({ open: false })
  }
}

closeView = () => this.setState({openModalView:false})

  confirmUploadReceipt = async() => {
    try{
      this.setState({loading:true})
      const transaction = this.state.transaction
      await arweave.transactions.sign(transaction, this.state.walletFile);
      const response = await arweave.transactions.post(transaction);
      console.log(transaction.id)
      let {status} = await arweave.transactions.getStatus(transaction.id)
      this.setState({loading:false, openModalTx:false, fee:'', transaction:'', rctData:''})
      alert('Transaction submitted successfully, please wait for some minutes to view')
    }catch(err){
      this.setState({loading:false, openModalTx:false, fee:'', transaction:'', rctData:''})
      alert('Error')
    }
  }

  decryptReceipt = async(txHash) => {
     try{
      this.setState({loading:true})
      const transaction = await arweave.transactions.get(txHash)
      const encryptData = await transaction.get('data', {decode: true, string: true})
      const pvKey = await jwkToPem(this.state.walletFile,{private:true})
      var decryptResult  = await CryptoJS.AES.decrypt(encryptData, pvKey);
      const rctString = await decryptResult.toString(CryptoJS.enc.Utf8)
      this.setState({loading:false, txView:txHash, rctDataView:rctString, openModalView:true})
     }catch(err){
       console.log(err)
       this.setState({loading:false})
       alert('Error')
   }
  }

  render(){
    return(
      <React.Fragment>
      <Grid padded>
        <Grid.Row color={"red"} key={"red"}>
          <Grid.Column>Receipts Archiver</Grid.Column>
        </Grid.Row>
       </Grid>
        <Grid centered> 
        {this.state.walletLoad ?
        <React.Fragment>
            <Grid centered>
            <Grid.Row style={{padding:0}}><p>{this.state.userAddress}</p></Grid.Row>
            <Grid.Row style={{padding:0}}> <p>{this.state.arBalance} AR</p></Grid.Row>
           
            <Grid.Row>
            <label style={{padding:20}} for="upload-rct" class="ui icon button">
              <i class="upload icon"></i>
              Upload Receipt
            </label>
            <input type="file" accept="application/pdf" onChange={ e => this.loadReceipt(e)} id="upload-rct" style={{display: "none"}}/>
            </Grid.Row>
            <Grid.Row>
              <p style={{fontWeight:800, fontSize:18}}>My Receipts</p>
            </Grid.Row>
            {(this.state.listTxImg.length === 0) && <Grid.Row><p>No Receipts</p></Grid.Row>}
            <Grid.Row>
              <List>
                {this.state.listTxImg.map(url => (
                      <List.Item>
                        <List.Content>
                          <List.Header onClick={() => this.decryptReceipt(url)} as='a'>{url}</List.Header>
                        </List.Content>
                    </List.Item>
                ))}
              </List>
            </Grid.Row>
            </Grid>
        </React.Fragment>
          :
		  
		  
          <React.Fragment>
		  <div>
		     <Segment padded>
				<h1>Archive your Receipts on Arweave permanently</h1>
				<img src='data:image/jpeg;base64,' style={{Width:1000, maxHeight:500}}/>
		
			</Segment>


  <Grid columns={1}>
    <Grid.Row stretched>
      <Grid.Column>
        <Segment>
		<label attached='bottom' htmlFor="hidden-new-file" class="ui icon button" >
              <i class="key icon"></i>
              Log In

            </label>
            <input type="file" onChange={ e => this.WalletUpload(e)} id="hidden-new-file" style={{display: "none"}}/>
		</Segment>
      </Grid.Column>

    </Grid.Row>
  </Grid>
		</div>
		

		
		
          </React.Fragment>

        }     
        </Grid>
        {this.state.loading && 
          <Dimmer active>
            <Loader size='large'>Loading</Loader>
          </Dimmer>
        }

        <Modal size={"tiny"} open={this.state.openModalTx} onClose={this.close}>
        {this.state.loading && 
          <Dimmer active>
            <Loader size='large'>Loading</Loader>
          </Dimmer>
        }
          <Modal.Header>Upload Receipt</Modal.Header>
          <Modal.Content>
            <Grid centered>
                <Grid.Row>
                  <p>Transaction Fee: {this.state.fee}</p>
                </Grid.Row>
                <Grid.Row>
                  <embed src={this.state.rctData} style={{maxWidth:512, maxHeight:150}} />
                </Grid.Row>
            </Grid>
          </Modal.Content>
          <Modal.Actions>
            <Button onClick={() => this.setState({openModalTx:false, fee:'' , transaction:'', rctData:''})} negative>Cancel</Button>
            <Button onClick={this.confirmUploadReceipt} positive icon='checkmark' labelPosition='right' content='Upload Receipt' />
          </Modal.Actions>
        </Modal>

        <Modal size={"tiny"} open={this.state.openModalView} onClose={this.closeView}>
          <Modal.Header>Receipt</Modal.Header>
          <Modal.Content>
            <Grid centered>
              <Grid.Row>
                <p>Tx: {this.state.txView}</p>
              </Grid.Row>
              <Grid.Row>
                <embed src={this.state.rctDataView} style={{maxWidth:512, maxHeight:150}} />
              </Grid.Row>
			  <Grid.Row>
                <a href={this.state.rctDataView} download>Download</a>
              </Grid.Row>
            </Grid>
          </Modal.Content>
        </Modal>
      </React.Fragment>
    )
  }
}

export default App;
